import Tabla from "./Tabla";
import ReactDOM from "react";
function Libros() {
    if (localStorage.getItem('privilegio') != null) {
        return[
            <div>
                  <h2 className="ml-3 text-center" style={{ color: "green" }}>Inicio</h2>
            </div>
        ];
    } else {
        window.location = 'http://localhost:3000/Login';
    }
}
export default Libros;
